import { useState ,useEffect } from 'react';
import '../../index.css';

function Login(params) {

  const handleSubmit = (event) => {
    event.preventDefault();
    console.log('Hellow dbjjfnsndjsd');
  }

  useEffect(() => {
    document.getElementById('login').addEventListener('click', handleSubmit);
  });

  return (

    <div className="container mt-5">
      <div className='my-auto mx-auto mt-5'>
        <h2>Login</h2>
        <form method='POST' className='w-50 mx-auto'>
          <div className="mb-3 text-start">
            <label htmlFor="exampleInputEmail1" className="form-label">Username</label>
            <input type="email" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"/>
          </div>
          <div className="mb-3 text-start">
            <label htmlFor="exampleInputPassword1" className="form-label">Password</label>
            <input type="password" className="form-control" id="exampleInputPassword1"/>
          </div>
          <button id='login' type="submit" className="btn btn-primary">Login</button>
        </form>
      </div>
    </div>
  );
}

export default Login;
